      m_action: {
        show_on_milestone: true,
        is_milestone: true,
      },
      id_client: user.id_client,
      t_logbook_status: f.id_staff
        ? {
            some: {
              id_action_role: {
                not: 1,
              },
              id_user: Number(f.id_staff),
            },
          }
        : {},
